import React from "react";
import { Category } from "./Category";

export const Categories = () => {
  const categories = [
    { name: "Pictures", files: 180, color: "blue" },
    { name: "Documents", files: 20, color: "orange" },
    { name: "Videos", files: 40, color: "cyan" },
    { name: "Audio", files: 10, color: "green" },
  ];

  return (
    <div>
      <h1 className="font-bodyFont text-3xl font-extrabold text-sky-950">
        Category
      </h1>

      {categories.map((category) => (
        <Category category={category} />
      ))}
    </div>
  );
};
